import React from 'react';
import { Routes, Route, Link } from "react-router-dom";
import Skills from "./Skills";
import Education from './Education';

const Experience = (resumeData) => {
    var message =
        Object.values(resumeData[0].experience[0]).map((experience, index) => (
            <div key={index}>
                <h3>{experience[0].position}</h3>
                <p>{experience[0].company}</p>
                <p>
                    {experience[0].startDate} - {experience[0].endDate}
                </p>
            </div>
        ))

    return (
        <div className="tab-contents active-tab" id="experience">
            <div>
                {message}
            </div>
        </div>
    );
}

const About = ({ resumeData }) => {
    return (
        <div id="about">
            <div className="about-header">
                <h1>Hi, I'm <span>{resumeData[0].name}!</span></h1>
            </div>
            <div className="about-content">
                <img src="images/meetPic.jpg" alt="Meet Suthar" />
                <div className="about-info">
                    <div className="about-info-title">
                        <h1 className="sub-title">About Me</h1>
                        <div>
                            {
                                resumeData[0].aboutMe
                            }
                        </div>
                    </div>
                    <div>
                        <nav className='tab-titles'>
                            <Link to="/skills" className="tab-links" >Skills</Link>
                            <Link to="/experience" className="tab-links" >Experience</Link>
                            <Link to="/education" className="tab-links" >Education</Link>
                        </nav>
                        <Routes>
                            <Route path="/skills" element={<Skills resumeData={resumeData} />}> </Route>
                            <Route path="/experience" element={<Experience resumeData={resumeData} />}> </Route>
                            <Route path="/education" element={<Education resumeData={resumeData} />} > </Route>
                        </Routes>
                    </div>
                </div>
            </div>
        </div>
    );

};

export default About;
